import SearchMenuBar from './menubar/SearchMenuBar'; 
import NavBar from './menubar/NavBar'; 
import logo from '../../../assets/logo.jpg'; 
import 'Header.css'

export default function Header() {
  return (
    <>
      {/* Search Menu Bar */}
      <SearchMenuBar logo={logo}/>
      
      {/* Nav Bar */}
      <NavBar logo={logo} />

      
    </>
  );
}
